class Solution {
public:
    long long continuousSubarrays(vector<int>& nums) {
        long long count = 0;
        int n = nums.size();
        for (int i = 0; i < n; ++i) {
            int minVal = nums[i], maxVal = nums[i];
            for (int j = i; j < n; ++j) {
                minVal = min(minVal, nums[j]);
                maxVal = max(maxVal, nums[j]);
                if (maxVal - minVal <= 2) count++;
                else break;
            }
        }
        return count;
    }
};
